import React, { useState } from 'react';

const Form = () => {
  const [phoneNumber, setPhoneNumber] = useState('');
  const [personality, setPersonality] = useState('');

  const handlePhoneNumberChange = (e) => {
    setPhoneNumber(e.target.value);
  };

  const handlePersonalityChange = (e) => {
    setPersonality(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    console.log('Phone Number:', phoneNumber);
    console.log('Personality:', personality);
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-pink-50">
      <div className="bg-white shadow-lg rounded-lg p-8 max-w-md w-full">
        <h2 className="text-2xl font-semibold text-center text-pink-600 mb-4">Aesthetic Form</h2>
        <form onSubmit={handleSubmit}>
          <div className="mb-4">
            <label className="block text-pink-600 text-sm font-bold mb-2" htmlFor="phone">
              Phone Number
            </label>
            <input
              type="text"
              id="phone"
              value={phoneNumber}
              onChange={handlePhoneNumberChange}
              className="shadow appearance-none border rounded w-full py-2 px-3 text-pink-700 leading-tight focus:outline-none focus:shadow-outline"
              placeholder="Enter your phone number"
            />
          </div>
          <div className="mb-4">
            <label className="block text-pink-600 text-sm font-bold mb-2" htmlFor="personality">
              Personality Type
            </label>
            <select
              id="personality"
              value={personality}
              onChange={handlePersonalityChange}
              className="block appearance-none w-full bg-white border border-pink-400 hover:border-pink-500 px-4 py-2 pr-8 rounded leading-tight focus:outline-none focus:shadow-outline text-pink-700"
            >
              <option value="" disabled>Select your personality</option>
              <option value="friendly">Friendly</option>
              <option value="professional">Professional</option>
              <option value="funny">Funny</option>
              <option value="serious">Serious</option>
            </select>
          </div>
          <div className="flex items-center justify-between">
            <button
              type="submit"
              className="bg-pink-600 hover:bg-pink-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
            >
              Submit
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default Form;
